# Get search page result
def search_result_page(sid):
    url = 'http://apps.webofknowledge.com/UA_AdvancedSearch_input.do?product=UA&replaceSetId=&goToPageLoc=SearchHistoryTableBanner&search_mode=AdvancedSearch&errorQid=1#SearchHistoryTableBanner&SID=' + sid
    session.get(url)

# Summary
def summary(sid):
    url = 'http://apps.webofknowledge.com/summary.do?product=UA&doc=1&qid=1&search_mode=AdvancedSearch&update_back2search_link_param=yes&SID=' + sid
    session.get(url)


