# Download
def download(sid, results_found, filename):
    url = 'http://ets.webofknowledge.com/ETS/ets.do'
    params = {
        'refineString':'null',
        ' displayUsageInfo':'true',

        'rurl':'http://apps.webofknowledge.com/summary.do?product=UA&page=1&qid=2&search_mode=CitationReportSID='+sid,
        'startYear':'2001',
        'endYear':ano_corrente ,

        'parentQid':'2',
        'qid':'3',

        'mark_from':'1',
        'mark_to':results_found,
        'totalMarked':results_found,

        'SID':sid,
        'product':'UA',
        'fileOpt':'csv',
        'displayCitedRefs':'true',
        'displayTimesCited':'false',
        'sortBy':'TC.D;PY.D;AU.A.en;SO.A.en;VL.D;PG.A',
        'timeSpan':'Timespan=All years',
        'UserIDForSaveToRID':'null',
        'action':'crsaveToFile',
        'filters':'',
    }
    params = urllib.urlencode(params)
    url = url + '?' + params

    session.cookies.clear()
    jar = requests.cookies.RequestsCookieJar()
    jar.set('CUSTOMER', '"FAPESP"', domain='.webofknowledge.com', path='/')
    jar.set('E_GROUP_NAME', '"FAPESP"', domain='.webofknowledge.com', path='/')
    jar.set('SID', '"'+sid+'"', domain='.webofknowledge.com', path='/')

    r = session.get(url, cookies=jar)

#     print "\n--------------"
#     print r.content
#     print "\n--------------"
#     print r.text
#     print "\n--------------"

    diretorio = '/var/tmp/bibtex/'
    if not os.path.exists(diretorio):
        os.makedirs(diretorio)
    open(diretorio + filename, 'wb').write(r.text.encode('UTF-8'))


def do_it_all(ut, filename):
    sid = get_sid()
    load_search_page(sid)
    submit_search_page(sid, ut)
    search_result_page(sid)
    summary(sid)
    results_found = create_citation_report(sid, ut)
    download(sid, results_found, filename)
    wos_exit(sid)


